import React from 'react';

const Card = (props) => {

    return (
      <div className="card">
        <h1>{props.title}</h1>
        <h3>{props.type}</h3>
        <ul>
          {props.data.map((d) => (
            d.map((obj) =>
              <li>{obj.value}</li>
            )
          ))}
        </ul>
      </div>
    );

}

export default Card;
